import React from 'react';
import { BrowserRouter as Router, Routes, Route, NavLink } from 'react-router-dom';
import './App.css';
import ClientesList from './components/Clientes/ClientesList';
import ClienteForm from './components/Clientes/ClienteForm';
import CobrancasList from './components/Cobrancas/CobrancasList';
import PlanosList from './components/Planos/PlanosList';

function App() {
  return (
    <Router>
      <div className="app">
        <header className="app-header">
          <h1>ðŸ’ª Sistema de CobranÃ§a - Pilates</h1>
        </header>
        <nav className="app-nav">
          <NavLink
            to="/clientes"
            className={({ isActive }) => (isActive ? 'active' : '')}
          >
            Clientes
          </NavLink>
          <NavLink
            to="/cobrancas"
            className={({ isActive }) => (isActive ? 'active' : '')}
          >
            CobranÃ§as
          </NavLink>
          <NavLink
            to="/planos"
            className={({ isActive }) => (isActive ? 'active' : '')}
          >
            Planos
          </NavLink>
        </nav>
        <main className="app-content">
          <Routes>
            <Route path="/" element={<ClientesList />} />
            <Route path="/clientes" element={<ClientesList />} />
            <Route path="/clientes/novo" element={<ClienteForm />} />
            <Route path="/clientes/:id/editar" element={<ClienteForm />} />
            <Route path="/cobrancas" element={<CobrancasList />} />
            <Route path="/planos" element={<PlanosList />} />
          </Routes>
        </main>
      </div>
    </Router>
  );
}

export default App;
